import {Component} from 'react'

const styles = {
    layout: {
        backgroundColor: '#fff',
        color: '#0A283E',
        alignItems:'center',
        display: 'flex',
        flexDirection: 'column'
    }
}
class Layout extends Component {
    render(){
        return(
        <div style={styles.layout}>
            <div>
                {this.props.children}
            </div>
            lalalalala
        </div>
        )
    }
}

export default Layout
